import Video from './demo_vids/attendance.mp4';
import Poster from './demo_vids/attendance.jpg';
import Img from './images/attendance.png';
export const facial = {
    lightBg: false,
    lightText: true,
    lightTextDesc: true,
    headline: 'Facial Attendance System',
    description:
      'In this feature our product uses Facial Recognition based Attendance Marking System. All employees have their data stored and then our product simply recognizes their face.',
    imgStart: '',
    img: Img,
    alt: 'Credit Card',
    path: Video,
    poster: Poster
  };
